import React from "react";
import styled from "styled-components";
import home from '../../assets/home.png';
import './'

function SideBar() {
  const Sidebar = styled.ul`
    text-align: left;
    width: 150px;
    font-family: "Mukta", sans-serif;
    margin: 0;
    position: absolute;
    left: 0;
    z-index: 1;
    display: flex;
    flex-direction: column;
  `;

  const Options = styled.a`
    color: white;
    list-style-type: none;
    font-family: "Mukta", sans-serif;
    font-size: 20px;
    padding: 10px 0;
    position: ${(props) => props.position || "block"};
    z-index: 9;
    background: ${((props) => props.background) || "none"};
    text-decoration: none;
  `;
  return (
    <Sidebar>
      <Options href="#">
        <span>
          <img src={home} alt="" className="icons" />
        </span>
        Home
      </Options>
      <Options href="#">Artists</Options>
      <Options href="#">Albums</Options>
      <Options href="#">Trends</Options>
      <Options href="#">Playlist</Options>
      <Options href="#">Profile</Options>
    </Sidebar>
  );
}

export default SideBar;
